import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
// import { postLoginToken } from "../api/postLoginToken";
// import {GoogleLogin} from "@react-oauth/google";
// import {GoogleOAuthProvider} from "@react-oauth/google";
import { useGoogleLogin } from "@react-oauth/google";
import Rabbit from "./../img/Group 12.png";
import { getUserInfo } from "../api/getUserInfo";
import Goggle from "./../img/icon/icGoggle.png";
import Cacao from "./../img/icon/icCacao.png";
import axios from "axios";
import PropTypes from 'prop-types';

const Login = ({ isLogin, setIsLogin, hasRequestedCallback, setHasRequestedCallback }) => {
  const navigate = useNavigate();
  const KAKAO_AUTH_URL = "https://kauth.kakao.com/oauth/authorize?client_id=d2c26f36c69325cd253b8d0b68802286&redirect_uri=https://mumul.site/login/kakao&response_type=code";

  const GoogleSocialLogin = useGoogleLogin({
    scope: "email profile",
    ux_mode: "redirect",
    // redirect_uri: "http://localhost:3000/login",
    flow: "auth-code",
  });

  const kakaoLogin = () => {
    window.location.href = KAKAO_AUTH_URL;
  }

  useEffect(() => {
    try{
      const queryParams = new URLSearchParams(window.location.search);
      const codeFromURL = queryParams.get("code");
  
      console.log(" codeFromURL: ", codeFromURL);
  
      if (!isLogin && !hasRequestedCallback && codeFromURL) {
        setHasRequestedCallback(true);
  
        axios
          .get(`https://api-mumul.site/v1/oauth/login/callback?code=${codeFromURL}`, {
            headers: {
              'Accept': 'application/json',
              'Content-Type': 'application/json',
            },
            withCredentials: true, //-> cors Î¨∏Ï†ú Ìï¥Í≤∞ ÏúÑÌï¥ ÏùºÎã® Ï£ºÏÑùÏ≤òÎ¶¨
            cache: 'no-cache', // Ï∫êÏãúÎ•º ÎπÑÏö∞Îäî ÏòµÏÖò Ï∂îÍ∞Ä
            crossDomain: true,
          })
  
          .then(response => {
            if(response.status===200){
              console.log("Login Ï†ÑÏ≤¥ ÏùëÎãµ: ", response.data);
  
              console.log("Authorization Ìó§Îçî Ï∂úÎ†•: ",response.headers.get('Authorization'));
    
              console.log("Authorization Ìó§ÎçîÍ∞í Ï°¥Ïû¨Ïó¨Î∂Ä: ",response.headers.has('Authorization'));
    
  
              const authToken = response.headers['authorization'];
              const authToken_=response.headers.get('Authorization');
          
              console.log("Login Ïùò authToken: ", authToken);
              console.log("Login Ïùò authToken_: ", authToken_);
              console.log("res.headers['authorization']: ", response.headers['authorization']);
              console.log("response.headers.get('authorization'): ", response.headers.get('authorization'));
              console.log("response.headers.Authorization: ", response.headers.Authorization);
              console.log("response.headers.authorization: ", response.headers.authorization);
  
              console.log("headers Ï†ÑÏ≤¥ Ï∂úÎ†•: ", response.headers);
    
    
              window.localStorage.setItem('token', authToken);
    
              // axios.defaults.headers.common[
              //   'Authorization'
              // ] = `Bearer ${authToken}`;
    
    
              setIsLogin(true);
            }
            
          })
          .catch((error) => {
            if (error.response) {
              console.error('ÏóêÎü¨Ïùò ÏùëÎãµ:', error.response);
              //do something
  
          } else if (error.request) {
              console.error('ÏóêÎü¨Ïùò ÏöîÏ≤≠:', error.request);
              //do something else
  
          } else if (error.message) {
              console.error('ÏóêÎü¨Ïùò Î©îÏãúÏßÄ:', error.message);
              //do something other than the other two
  
          }
      
          return false;
          });
      }
  
      console.log("login.js Î°úÍ∑∏Ïù∏Ïó¨Î∂Ä 2: " + isLogin);
  
      if (isLogin) {
        console.log("Login.js Î°úÍ∑∏Ïù∏ trueÏûÑ");
        const initLogin = async () => {
          const userInfo = await getUserInfo();
          console.log("userInfo: ", userInfo);
          console.log("userInfo.userId: ", userInfo.userId);
          if (userInfo === false) {
            console.log("Login.js Î°úÍ∑∏Ïù∏ trueÏù∏Îç∞ Ï†ÄÏû•Îêú userInfoÎäî ÏóÜÏùå false");
            setIsLogin(false);
          }
  
          navigate(`/${userInfo.userId}`);
          console.log("Login.js Î°úÍ∑∏Ïù∏ true, Ï†ÄÏû•Îêú userInfoÏûàÏñ¥ÏÑú ÏûêÎèô ÎÑ§ÎπÑÍ≤åÏù¥ÌÑ∞");
          setHasRequestedCallback(false);
        };
        initLogin();
      }
    }catch(error){
      if (error.response) {
        console.error('ÏóêÎü¨Ïùò ÏùëÎãµ:', error.response);
        //do something

    } else if (error.request) {
        console.error('ÏóêÎü¨Ïùò ÏöîÏ≤≠:', error.request);
        //do something else

    } else if (error.message) {
        console.error('ÏóêÎü¨Ïùò Î©îÏãúÏßÄ:', error.message);
        //do something other than the other two

    }

    return false;
    }

    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [isLogin, setHasRequestedCallback, navigate, setIsLogin]);


  return (
    <div className="wrap">
      <div className="content">
        <h1 className="title">MUMUL</h1>
        <div className="loginWrap">
          <div className="img">
            <img src={Rabbit} alt="rabbit" />
          </div>
          <div>
            <div className="text">
              <p className="loginTitle">
                Î∞îÏÅòÎã§ Î∞îÎπ† ÌòÑÎåÄ ÏÇ¨Ìöå!
                <br />
                Î∞òÍ∞ÄÏõå ÎÇú ÌÜ†ÎÅºÏïºüê∞
              </p>
              <p className="loginDecs">MUMUL Ïä§ÌéòÏù¥Ïä§Î•º ÎßåÎìúÎ†§Î©¥ Î°úÍ∑∏Ïù∏ÏùÑ Ìï¥Ïïº Îèº</p>
            </div>
            <div className="buttonWrap">
              <button onClick={kakaoLogin}>
                <img src={Cacao} alt="" />
                Kakao Í≥ÑÏ†ïÏúºÎ°ú Í≥ÑÏÜç
              </button>
              <button onClick={GoogleSocialLogin}>
                <img src={Goggle} alt="" />
                Google Í≥ÑÏ†ïÏúºÎ°ú Í≥ÑÏÜç
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

Login.propTypes = {
  isLogin: PropTypes.any.isRequired,
  setIsLogin: PropTypes.any.isRequired,
  hasRequestedCallback: PropTypes.any.isRequired,
  setHasRequestedCallback: PropTypes.any.isRequired,
}


export default Login;
